import './App.css';



// 최상위 컴포넌트
function App() {
  const count = 100;
  const onClick = () => {
    count += 1;
  }
  return (
    <div>
      <h1>Total Count: ${count}</h1>
      <button onClick="onClick">증가</button><br/>
    </div>
  );
}

export default App;
